import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function AdminForm() {
    const [formData, setFormData] = useState({
        banner: "",
        name: "",
        description: "",
        document1: "",
        document2: "",
        document3: "",
    });

    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit the service form to the backend or store locally
        console.log("Service added:", formData);

        // Redirect to services page after submitting
        navigate("/services");
    };

    return (
        <div className="p-8">
            <h2 className="text-2xl font-semibold mb-4">Add a New Service</h2>
            <form onSubmit={handleSubmit}>
                <div className="mb-4">
                    <label htmlFor="banner" className="block text-sm font-semibold">Service Banner URL</label>
                    <input
                        type="text"
                        name="banner"
                        value={formData.banner}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <div className="mb-4">
                    <label htmlFor="name" className="block text-sm font-semibold">Service Name</label>
                    <input
                        type="text"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <div className="mb-4">
                    <label htmlFor="description" className="block text-sm font-semibold">Service Description</label>
                    <textarea
                        name="description"
                        value={formData.description}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <div className="mb-4">
                    <label htmlFor="document1" className="block text-sm font-semibold">Document Required 1</label>
                    <input
                        type="text"
                        name="document1"
                        value={formData.document1}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <div className="mb-4">
                    <label htmlFor="document2" className="block text-sm font-semibold">Document Required 2</label>
                    <input
                        type="text"
                        name="document2"
                        value={formData.document2}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <div className="mb-4">
                    <label htmlFor="document3" className="block text-sm font-semibold">Document Required 3</label>
                    <input
                        type="text"
                        name="document3"
                        value={formData.document3}
                        onChange={handleChange}
                        className="border p-2 w-full rounded-md"
                    />
                </div>

                <button
                    type="submit"
                    className="bg-blue-500 text-white px-6 py-2 rounded-full"
                >
                    Add Service
                </button>
            </form>
        </div>
    );
}

export default AdminForm;
